function getClubLogoB64(club){
  // Retourne l'URL du SVG depuis /assets/logos/
  if(!club) return '';
  function slug(s){ return String(s).toLowerCase().replace(/[^a-z0-9]+/g,'-').replace(/^-|-$/g,''); }
  const cSlug = slug(typeof club==='string' ? club : (club.name||club.full||''));
  // Recherche directe par nom
  const direct = LOGOS_DB[typeof club==='string' ? club : (club.name||club.full||'')];
  if(direct) return `/assets/logos/${direct}.svg`;
  // Recherche par slug
  for(const[k,v] of Object.entries(LOGOS_DB)){
    if(slug(k)===cSlug) return `/assets/logos/${v}.svg`;
  }
  return '';
}
