function _escapeHtml(str){
  return String(str ?? "")
    .replace(/&/g,"&amp;")
    .replace(/</g,"&lt;")
    .replace(/>/g,"&gt;")
    .replace(/"/g,"&quot;")
    .replace(/'/g,"&#039;");
}

function brandLogoHtml(brand, size){
  const label = String(brand ?? "").trim();
  if(!label) return "";
  const px = Number.isFinite(+size) ? Math.max(12, +size) : 16;

  const key = label.toLowerCase();
  // BRAND_LOGOS is loaded from Supabase (table "brands") when available
  let src = "";
  if(window.BRAND_LOGOS){
    // exact match first
    if(window.BRAND_LOGOS[key]) src = window.BRAND_LOGOS[key];
    // substring match (ex: "Topps Chrome")
    if(!src){
      for(const k of Object.keys(window.BRAND_LOGOS)){
        if(key.includes(k)){ src = window.BRAND_LOGOS[k]; break; }
      }
    }
  }

  if(src){
    return `<img class="brand-logo" src="${src}" alt="${_escapeHtml(label)}" style="height:${px}px;max-width:${px*3}px;object-fit:contain;">`;
  }

  // fallback: text
  return `<span class="brand-pill brand-generic" style="font-size:${Math.min(14, px)}px;line-height:1;">${_escapeHtml(label)}</span>`;
}

function showGyroBtn(){
  const sc=document.getElementById("card-3d-scene");
  if(sc.querySelector(".gyro-btn"))return;
  const btn=document.createElement("button");
  btn.className="gyro-btn";
  btn.textContent=" Activer le tilt";
  btn.onclick=async()=>{
    try{
      const p=await DeviceOrientationEvent.requestPermission();
      if(p==="granted"){startGyro();btn.remove();}
      else{btn.textContent="Refusé";setTimeout(()=>btn.remove(),1500);}
    }catch(e){startGyro();btn.remove();}
  };
  sc.appendChild(btn);
}

function startGyro(){
  if(gyroH)window.removeEventListener("deviceorientation",gyroH,true);
  gyroRef={b:null,g:null};
  let n=0;
  gyroH=e=>{
    if(e.beta===null||e.gamma===null)return;
    // Calibrate first 8 frames
    if(n<8){
      gyroRef.b=gyroRef.b===null?e.beta:(gyroRef.b*n+e.beta)/(n+1);
      gyroRef.g=gyroRef.g===null?e.gamma:(gyroRef.g*n+e.gamma)/(n+1);
      n++;return;
    }
    if(!isFlipped){
      // gamma = left/right tilt → rotateY (inverted: tilt right = card goes left)
      // beta  = forward/back tilt → rotateX
      tRY=Math.max(-28,Math.min(28,(e.gamma-gyroRef.g)*-1.2));
      tRX=Math.max(-20,Math.min(20,(e.beta-gyroRef.b)*0.9));
    }
  };
  window.addEventListener("deviceorientation",gyroH,true);
  // Remove CSS animation since we have live tilt
  const fi=document.getElementById("card-flip-inner");
  if(fi)fi.style.animation="none";
}

function stopGyro(){
  if(gyroH){window.removeEventListener("deviceorientation",gyroH,true);gyroH=null;}
  if(rafTilt){cancelAnimationFrame(rafTilt);rafTilt=null;}
  tRX=0;tRY=0;cRX=0;cRY=0;
}

