function renderPie(){
  const wrap=document.getElementById("home-pie-wrap");
  const svg=document.getElementById("pie-svg");
  const legend=document.getElementById("pie-legend");
  if(!wrap||!svg||!legend)return;
  const cards=db.cards.filter(c=>c.price>0);
  const counts={};
  cards.forEach(c=>{const b=c.marque||"Autre";counts[b]=(counts[b]||0)+1;});
  if(cards.length===0){wrap.style.display="none";return;}
  const byBrand={};
  cards.forEach(c=>{const b=c.marque||"Autre";byBrand[b]=(byBrand[b]||0)+(c.price||0);});
  const entries=Object.entries(byBrand).sort((a,b)=>b[1]-a[1]);
  const total=entries.reduce((s,[,v])=>s+v,0);
  if(total===0){wrap.style.display="none";return;}
  wrap.style.display="";
  const tc=document.getElementById("total-cards");
  if(tc) tc.textContent = `${db.cards.length} cartes`;
  const COLORS=["var(--accent)","#ff6b6b","#ffd93d","#6bcb77","#4d96ff","#c77dff","#ff9f1c"];
  let angle=0;
  let pathHTML="",legendHTML="";
  entries.forEach(([name,val],i)=>{
    const pct=val/total;
    const a1=angle,a2=angle+pct*Math.PI*2;
    const r=40,cx=45,cy=45;
    const x1=cx+r*Math.sin(a1),y1=cy-r*Math.cos(a1);
    const x2=cx+r*Math.sin(a2),y2=cy-r*Math.cos(a2);
    const large=pct>0.5?1:0;
    const color=COLORS[i%COLORS.length];
    pathHTML+=`<path d="M${cx},${cy} L${x1},${y1} A${r},${r} 0 ${large},1 ${x2},${y2} Z" fill="${color}" stroke="var(--bg)" stroke-width="1"/>`;
    legendHTML+=`<div style="display:flex;align-items:center;gap:5px;font-size:11px;"><span style="width:8px;height:8px;border-radius:50%;background:${color};flex-shrink:0;"></span>${name} <span style="opacity:.5;">${(counts[name]||0)} cartes</span></div>`;
    angle=a2;
  });
  svg.innerHTML=pathHTML;
  legend.innerHTML=legendHTML;
}

