function compressImage(dataUrl,cb){
  const img=new Image();
  img.onload=()=>{
    // Cible: max 1200px côté long, qualité adaptative pour rester < 300KB
    const MAX=1200; let w=img.width, h=img.height;
    if(w>h){ if(w>MAX){h=Math.round(h*MAX/w);w=MAX;} }
    else    { if(h>MAX){w=Math.round(w*MAX/h);h=MAX;} }
    const c=document.createElement("canvas"); c.width=w; c.height=h;
    c.getContext("2d").drawImage(img,0,0,w,h);
    // Première passe à 0.80
    let result = c.toDataURL("image/jpeg", 0.80);
    // Si encore > ~400KB (base64 ~533KB) → deuxième passe plus agressive
    if(result.length > 533000){
      // Réduire à 900px
      const MAX2=900; let w2=w, h2=h;
      if(w2>h2){ if(w2>MAX2){h2=Math.round(h2*MAX2/w2);w2=MAX2;} }
      else      { if(h2>MAX2){w2=Math.round(w2*MAX2/h2);h2=MAX2;} }
      const c2=document.createElement("canvas"); c2.width=w2; c2.height=h2;
      c2.getContext("2d").drawImage(img,0,0,w2,h2);
      result = c2.toDataURL("image/jpeg", 0.72);
    }
    cb(result);
  };
  img.src=dataUrl;
}

function handlePhoto(inp,side){
  const f=inp.files[0];if(!f)return;
  const r=new FileReader();
  r.onload=e=>compressImage(e.target.result,data=>{
    addPhoto[side]=data;
  if(side==='verso') updateVersoTabState();addCrop[side]=null;
    if(side==="recto"){
      document.getElementById("photo-preview-img").src=data;
      document.getElementById("photo-preview-wrap").style.display="block";
      document.getElementById("photo-placeholder-ui").style.display="none";
      document.getElementById("crop-btn").style.display="block";
      window._lastScanDataUrl = data; // for OCR
    }else{
      document.getElementById("photo-preview-img-v").src=data;
      document.getElementById("photo-preview-wrap-v").style.display="block";
      document.getElementById("photo-placeholder-ui-v").style.display="none";
      document.getElementById("crop-btn-v").style.display="block";
    }
  });
  r.readAsDataURL(f);
}

function openCrop(side){
  cropTarget = side;
  let src;
  if(side === 'edit-recto'){
    src = editPhoto.recto;
    if(!src){
      const el = document.getElementById('e-preview-img');
      src = el ? el.src : null;
    }
  } else if(side === 'edit-verso'){
    src = editPhoto.verso;
    if(!src){
      const el = document.getElementById('e-preview-img-v');
      src = el ? el.src : null;
    }
  } else {
    src = addPhoto[side];
  }
  if(!src){ showToast("Ajoute d'abord une photo"); return; }

  const overlay = document.getElementById("crop-overlay");
  overlay.classList.add("open");

  // If it's already a dataURL or blob → load directly (no CORS issue)
  if(src.startsWith('data:') || src.startsWith('blob:')){
    _loadCropImg(src);
    return;
  }

  // External URL (Supabase CDN) → fetch as blob to avoid tainted canvas
  showToast("Chargement…");
  fetch(src)
    .then(r => r.blob())
    .then(blob => {
      const blobUrl = URL.createObjectURL(blob);
      _loadCropImg(blobUrl);
    })
    .catch(() => {
      // fetch blocked → try direct load with crossOrigin
      _loadCropImg(src, true);
    });
}

function _loadCropImg(src, withCORS){
  const img = document.getElementById("crop-img");
  img.onload  = () => requestAnimationFrame(() => initCrop());
  img.onerror = () => showToast("Impossible de charger l'image");
  if(withCORS) img.crossOrigin = "anonymous";
  else img.crossOrigin = "";
  img.src = "";
  img.src = src;
  if(img.complete && img.naturalWidth > 0) requestAnimationFrame(() => initCrop());
}


// ===== Crop v2 (interactive + enhance + quality) =====
let _cropState = {
  side: "recto",
  img: null,
  loaded: false,
  panX: 0,
  panY: 0,
  baseScale: 1,
  zoom: 1,
  frameRatio: 0.78,
  brightness: 1,
  contrast: 1,
  dragging: false,
  lastX: 0,
  lastY: 0
};

function getCropEl(id){ return document.getElementById(id); }
function getCropQuality(){
  const raw = parseFloat(getCropEl('crop-quality')?.value || "88");
  const q = raw > 1 ? raw / 100 : raw;
  return Math.min(1, Math.max(0.55, q));
}
function cropResetEnhance(){
  const b = getCropEl('crop-brightness'); if(b){ b.value = "100"; } const bpct=document.getElementById('crop-brightness-pct'); if(bpct) bpct.textContent='100%';
  const c = getCropEl('crop-contrast'); if(c){ c.value = "100"; } const cpct=document.getElementById('crop-contrast-pct'); if(cpct) cpct.textContent='100%';
  _cropState.brightness = 1; _cropState.contrast = 1;
  drawCrop();
}

function initCrop(){
  const canvas = getCropEl("crop-canvas");
  const wrap = canvas?.closest(".crop-wrap");
  const imgEl = getCropEl("crop-img");
  if(!canvas || !wrap || !imgEl) return;

  // Build Image() for correct sizing - src is always blob/dataURL at this point
  const img = new Image();
  img.onload = ()=>{
    _cropState.img = img;
    _cropState.loaded = true;

    // size canvas to wrap
    const dpr = window.devicePixelRatio || 1;
    const w = Math.max(240, wrap.clientWidth);
    const h = Math.max(240, wrap.clientHeight);
    canvas.width = Math.round(w * dpr);
    canvas.height = Math.round(h * dpr);
    canvas.style.width = w + "px";
    canvas.style.height = h + "px";

    // base scale to "cover" frame
    _cropState.panX = 0; _cropState.panY = 0;
    _cropState.zoom = parseFloat(getCropEl('crop-zoom')?.value || "1");
    _cropState.frameRatio = parseFloat(getCropEl('crop-size')?.value || "0.78");
    _cropState.brightness = (parseFloat(getCropEl('crop-brightness')?.value || "100")) / 100;
    _cropState.contrast = (parseFloat(getCropEl('crop-contrast')?.value || "100")) / 100;

    computeBaseScale();
    bindCropControls();
    bindCropDrag();
    drawCrop();
  };
  img.src = imgEl.src;
}

function computeBaseScale(){
  const canvas = getCropEl("crop-canvas");
  if(!_cropState.img || !canvas) return;
  const dpr = window.devicePixelRatio || 1;
  const cw = canvas.width / dpr;
  const ch = canvas.height / dpr;
  const frame = getFrameRect(cw, ch, _cropState.frameRatio);
  const iw = _cropState.img.naturalWidth;
  const ih = _cropState.img.naturalHeight;

  // cover frame
  const s = Math.max(frame.w / iw, frame.h / ih);
  _cropState.baseScale = s;
}

function getFrameRect(cw, ch, ratio){
  const size = Math.min(cw, ch) * ratio;
  return { x:(cw-size)/2, y:(ch-size)/2, w:size, h:size };
}

function bindCropControls(){
  const ids = ["crop-size","crop-zoom","crop-brightness","crop-contrast"];
  ids.forEach(id=>{
    const el = getCropEl(id);
    if(!el) return;
    if(el.dataset.bound === "1") return;
    el.dataset.bound = "1";
    el.addEventListener("input", ()=>{
      if(id==="crop-size"){ _cropState.frameRatio = parseFloat(el.value||"0.78"); computeBaseScale(); clampPan(); }
      if(id==="crop-zoom"){ _cropState.zoom = parseFloat(el.value||"1"); clampPan(); }
      if(id==="crop-brightness"){ _cropState.brightness = parseFloat(el.value||"100")/100; const p=document.getElementById('crop-brightness-pct'); if(p) p.textContent=el.value+'%'; }
      if(id==="crop-contrast"){ _cropState.contrast = parseFloat(el.value||"100")/100; const p=document.getElementById('crop-contrast-pct'); if(p) p.textContent=el.value+'%'; }
      drawCrop();
    });
  });
  window.addEventListener("resize", ()=>{
    // re-init sizing if overlay open
    const overlay = getCropEl("crop-overlay");
    if(overlay?.classList.contains("open")) initCrop();
  });
}

function bindCropDrag(){
  const canvas = getCropEl("crop-canvas");
  if(!canvas || canvas.dataset.bound === "1") return;
  canvas.dataset.bound = "1";

  canvas.addEventListener("pointerdown", (e)=>{
    _cropState.dragging = true;
    _cropState.lastX = e.clientX;
    _cropState.lastY = e.clientY;
    try{ canvas.setPointerCapture(e.pointerId); }catch(_){}
  });
  canvas.addEventListener("pointermove", (e)=>{
    if(!_cropState.dragging) return;
    const dx = e.clientX - _cropState.lastX;
    const dy = e.clientY - _cropState.lastY;
    _cropState.lastX = e.clientX; _cropState.lastY = e.clientY;
    _cropState.panX += dx;
    _cropState.panY += dy;
    clampPan();
    drawCrop();
  });
  const end = (e)=>{
    _cropState.dragging = false;
    try{ canvas.releasePointerCapture(e.pointerId); }catch(_){}
  };
  canvas.addEventListener("pointerup", end);
  canvas.addEventListener("pointercancel", end);
}

function clampPan(){
  const canvas = getCropEl("crop-canvas");
  if(!_cropState.img || !canvas) return;
  const dpr = window.devicePixelRatio || 1;
  const cw = canvas.width / dpr;
  const ch = canvas.height / dpr;
  const frame = getFrameRect(cw, ch, _cropState.frameRatio);

  const iw = _cropState.img.naturalWidth;
  const ih = _cropState.img.naturalHeight;
  const scale = _cropState.baseScale * _cropState.zoom;

  const drawnW = iw * scale;
  const drawnH = ih * scale;

  // image center at (cw/2 + panX, ch/2 + panY)
  // ensure image covers frame: edges beyond frame
  const minX = (frame.x + frame.w) - (cw/2) - (drawnW/2);
  const maxX = (frame.x) - (cw/2) + (drawnW/2);
  const minY = (frame.y + frame.h) - (ch/2) - (drawnH/2);
  const maxY = (frame.y) - (ch/2) + (drawnH/2);

  _cropState.panX = Math.max(minX, Math.min(maxX, _cropState.panX));
  _cropState.panY = Math.max(minY, Math.min(maxY, _cropState.panY));
}

function drawCrop(){
  const canvas = getCropEl("crop-canvas");
  if(!_cropState.loaded || !_cropState.img || !canvas) return;

  const ctx = canvas.getContext("2d");
  const dpr = window.devicePixelRatio || 1;
  const cw = canvas.width / dpr;
  const ch = canvas.height / dpr;

  ctx.setTransform(dpr,0,0,dpr,0,0);
  ctx.clearRect(0,0,cw,ch);

  const frame = getFrameRect(cw, ch, _cropState.frameRatio);

  const iw = _cropState.img.naturalWidth;
  const ih = _cropState.img.naturalHeight;
  const scale = _cropState.baseScale * _cropState.zoom;

  const centerX = cw/2 + _cropState.panX;
  const centerY = ch/2 + _cropState.panY;
  const dx = centerX - (iw*scale)/2;
  const dy = centerY - (ih*scale)/2;

  ctx.filter = `brightness(${_cropState.brightness}) contrast(${_cropState.contrast})`;
  ctx.drawImage(_cropState.img, dx, dy, iw*scale, ih*scale);
  ctx.filter = "none";

  // darken outside frame
  ctx.fillStyle = "rgba(0,0,0,.45)";
  ctx.fillRect(0,0,cw,frame.y);
  ctx.fillRect(0,frame.y,frame.x,frame.h);
  ctx.fillRect(frame.x+frame.w,frame.y,cw-(frame.x+frame.w),frame.h);
  ctx.fillRect(0,frame.y+frame.h,cw,ch-(frame.y+frame.h));

  // frame stroke
  ctx.strokeStyle = "rgba(255,255,255,.85)";
  ctx.lineWidth = 2;
  ctx.strokeRect(frame.x, frame.y, frame.w, frame.h);
}

function applyCrop(){
  const canvas = getCropEl("crop-canvas");
  if(!_cropState.loaded || !_cropState.img || !canvas){ closeCrop(); return; }

  const dpr = window.devicePixelRatio || 1;
  const cw = canvas.width / dpr;
  const ch = canvas.height / dpr;
  const frame = getFrameRect(cw, ch, _cropState.frameRatio);

  const out = document.createElement("canvas");
  out.width = Math.round(frame.w * dpr);
  out.height = Math.round(frame.h * dpr);
  const octx = out.getContext("2d");

  // draw same image, but shifted so that frame maps to (0,0)
  octx.setTransform(dpr,0,0,dpr,0,0);
  octx.filter = `brightness(${_cropState.brightness}) contrast(${_cropState.contrast})`;

  const iw = _cropState.img.naturalWidth;
  const ih = _cropState.img.naturalHeight;
  const scale = _cropState.baseScale * _cropState.zoom;

  const centerX = cw/2 + _cropState.panX;
  const centerY = ch/2 + _cropState.panY;
  const dx = centerX - (iw*scale)/2;
  const dy = centerY - (ih*scale)/2;

  // shift by -frame.x/y
  octx.drawImage(_cropState.img, dx - frame.x, dy - frame.y, iw*scale, ih*scale);
  octx.filter = "none";

  const data = out.toDataURL("image/jpeg", getCropQuality());

  if(cropTarget === 'edit-recto'){
    // Edit mode - recto
    editCrop.recto = data;
    editPhoto.recto = data;
    const prev = document.getElementById('e-preview-img');
    if(prev){ prev.src = data; }
    const wrap = document.getElementById('e-preview-wrap');
    if(wrap) wrap.style.display = 'block';
    const ph = document.getElementById('e-placeholder');
    if(ph) ph.style.display = 'none';
  } else if(cropTarget === 'edit-verso'){
    // Edit mode - verso
    editCrop.verso = data;
    editPhoto.verso = data;
    const prev = document.getElementById('e-preview-img-v');
    if(prev){ prev.src = data; }
    const wrap = document.getElementById('e-preview-wrap-v');
    if(wrap) wrap.style.display = 'block';
    const ph = document.getElementById('e-placeholder-v');
    if(ph) ph.style.display = 'none';
  } else if(cropTarget === 'recto'){
    addCrop.recto = data;
    document.getElementById("photo-preview-img").src = data;
    window._lastScanDataUrl = data;
  } else {
    addCrop.verso = data;
    document.getElementById("photo-preview-img-v").src = data;
    updateVersoTabState();
  }

  closeCrop();
  showToast("✅ Recadré !");
}
// ===== end Crop v2 =====



