function setupImageViewer(){
  const viewer = document.getElementById('img-viewer');
  const closeBtn = document.getElementById('img-viewer-close');
  const img = document.getElementById('img-viewer-img');
  if(!viewer || !closeBtn || !img) return;

  function close(){
    viewer.style.display='none';
    viewer.setAttribute('aria-hidden','true');
    img.src='';
    document.body.classList.remove('no-scroll');
  }
  closeBtn.addEventListener('click', close);
  viewer.addEventListener('click', (e)=>{ if(e.target===viewer) close(); });
  document.addEventListener('keydown', (e)=>{ if(e.key==='Escape') close(); });

  // Delegate clicks on card images
  document.addEventListener('click', (e)=>{
    const el = e.target.closest('img');
    if(!el) return;
    // heuristics: only images inside card detail or card tiles
    const inCard = el.closest('#page-card, .card-detail, .card-photo, .card-tile, [data-card-id]');
    if(!inCard) return;
    const src = el.getAttribute('src');
    if(!src) return;
    // avoid opening for tiny icons/logos
    const w = el.naturalWidth || 0;
    const h = el.naturalHeight || 0;
    if((w && h) && (w*h < 200*200)) return;

    img.src = src;
    viewer.style.display='flex';
    viewer.setAttribute('aria-hidden','false');
    document.body.classList.add('no-scroll');
  }, true);
}


// --- robust 3D tilt with gyroscope (card detail) ---
function setupGyroTilt(){
  const card = document.querySelector('#page-card .card-3d, #page-card .card-photo, #page-card .card, #page-card .detail-card');
  if(!card) return;

  let enabled = false;
  let raf = 0;
  let latest = {beta:0, gamma:0};

  function apply(beta, gamma){
    // beta: front/back [-180..180], gamma: left/right [-90..90]
    const maxTilt = 12; // degrees
    const rx = Math.max(-maxTilt, Math.min(maxTilt, (beta||0) / 6));
    const ry = Math.max(-maxTilt, Math.min(maxTilt, (gamma||0) / 6));
    card.style.transform = `perspective(900px) rotateX(${rx}deg) rotateY(${ry}deg)`;
  }

  function onOrient(e){
    latest.beta = e.beta ?? 0;
    latest.gamma = e.gamma ?? 0;
    if(!raf){
      raf = requestAnimationFrame(()=>{
        raf = 0;
        apply(latest.beta, latest.gamma);
      });
    }
  }

  async function enable(){
    if(enabled) return true;
    try{
      // iOS permission
      if(typeof DeviceOrientationEvent !== 'undefined' && typeof DeviceOrientationEvent.requestPermission === 'function'){
        const p = await DeviceOrientationEvent.requestPermission();
        if(p !== 'granted') return false;
      }
      window.addEventListener('deviceorientation', onOrient, {passive:true});
      enabled = true;
      return true;
    }catch(err){
      console.warn('gyro enable failed', err);
      return false;
    }
  }

  // Make sure perspective works and there is a subtle shadow/outline only
  card.style.transformStyle = 'preserve-3d';
  card.style.willChange = 'transform';

  // Try auto-enable on Android; on iOS needs user gesture → attach to first tap on detail page
  enable();

  // If iOS blocks, ask on first interaction in card page
  document.addEventListener('click', async (e)=>{
    const inCardPage = e.target.closest('#page-card');
    if(!inCardPage) return;
    if(enabled) return;
    const ok = await enable();
    if(!ok){
      // fallback to pointer tilt
      card.dataset.pointerTilt = "1";
    }
  }, {capture:true, passive:true});

  // Fallback: pointer move tilt
  function pointerMove(e){
    const rect = card.getBoundingClientRect();
    const x = (e.clientX - rect.left) / rect.width;   // 0..1
    const y = (e.clientY - rect.top) / rect.height;   // 0..1
    const maxTilt = 10;
    const ry = (x - 0.5) * (maxTilt*2);
    const rx = -(y - 0.5) * (maxTilt*2);
    card.style.transform = `perspective(900px) rotateX(${rx}deg) rotateY(${ry}deg)`;
  }
  card.addEventListener('pointermove', (e)=>{
    if(!enabled) pointerMove(e);
  });
  card.addEventListener('pointerleave', ()=>{
    card.style.transform = 'perspective(900px) rotateX(0deg) rotateY(0deg)';
  });
}
// --- end gyro tilt ---


