// --- Drag-to-tilt (finger-controlled 3D) ---
function enableDragTilt(el){
  if(!el) return;
  let rect = null;
  let active = false;
  const maxTilt = 14; // degrees

  function onDown(e){
    active = true;
    rect = el.getBoundingClientRect();
    try{ el.setPointerCapture(e.pointerId); }catch(_){}
    el.classList.add('is-tilting');
  }

  function onMove(e){
    if(!active || !rect) return;
    const x = (e.clientX - rect.left) / rect.width;  // 0..1
    const y = (e.clientY - rect.top) / rect.height;  // 0..1
    const rx = (0.5 - y) * (maxTilt * 2);
    const ry = (x - 0.5) * (maxTilt * 2);
    el.style.transform = `perspective(900px) rotateX(${rx}deg) rotateY(${ry}deg)`;
  }

  function onUp(e){
    active = false;
    try{ el.releasePointerCapture(e.pointerId); }catch(_){}
    el.classList.remove('is-tilting');
    el.style.transform = "perspective(900px) rotateX(0deg) rotateY(0deg)";
  }

  // Ensure we don't double-bind
  if(el.dataset.dragTiltBound === "1") return;
  el.dataset.dragTiltBound = "1";

  el.addEventListener("pointerdown", onDown);
  el.addEventListener("pointermove", onMove);
  el.addEventListener("pointerup", onUp);
  el.addEventListener("pointercancel", onUp);
  el.addEventListener("pointerleave", ()=>{ if(active) onUp({pointerId:0}); });
}
