// --- OCR.space + parser (prefill fields) ---
async function ocrCard(){
  try{
    const img = document.getElementById('photo-preview-img');
    const dataUrl = (window._lastScanDataUrl) || (img && img.src) || "";
    if(!dataUrl || !String(dataUrl).startsWith('data:image')){
      showToast?.("Ajoute une image (recto) d'abord", "warn");
      return;
    }
    if(!window.GEMINI_API_KEY || String(window.GEMINI_API_KEY).length < 20){
      showToast?.("Clé Gemini manquante", "error");
      return;
    }

    showToast?.("Analyse OCR…", "info");

    const mimeType = (dataUrl.match(/^data:(image\/[^;]+);base64,/i) || [])[1] || "image/jpeg";
    const base64Data = String(dataUrl).split(',')[1] || "";

    const prompt = `
      Analyse cette image de carte de sport.
      Extrais les informations et renvoie-les UNIQUEMENT sous la forme d'un objet JSON valide avec ces clés exactes :
      - "prenom"
      - "nom"
      - "club" (Nom de l'équipe ou du club. Détecte-le via le texte écrit OU via le logo de l'équipe s'il est présent. Si sport individuel sans club, laisse vide).
      - "editeur"
      - "collection"
      - "hasPatch" (booléen true/false : y a-t-il un morceau de maillot, tissu ou memorabilia intégré dans la carte ?)
      - "hasAutograph" (booléen true/false : y a-t-il une signature manuscrite sur la carte ?)

      Ne rajoute aucun texte avant ou après le JSON.
    `;

    const requestBody = {
      contents: [{
        role: "user",
        parts: [
          { text: prompt },
          { inlineData: { mimeType, data: base64Data } }
        ]
      }]
    };

    const modelCandidates = [
      "gemini-1.5-flash-002",
      "gemini-1.5-flash-001",
      "gemini-1.5-flash"
    ];

    let lastErr = null;
    let rawText = null;

    for(const model of modelCandidates){
      try{
        const url = `https://generativelanguage.googleapis.com/v1beta/models/${model}:generateContent?key=${encodeURIComponent(window.GEMINI_API_KEY)}`;
        const res = await fetch(url,{
          method:"POST",
          headers:{ "Content-Type":"application/json" },
          body: JSON.stringify(requestBody)
        });
        const json = await res.json().catch(()=> ({}));
        if(!res.ok){
          // 404 model not found -> try next
          lastErr = new Error(json?.error?.message || `Gemini HTTP ${res.status}`);
          continue;
        }
        rawText = json?.candidates?.[0]?.content?.parts?.[0]?.text || "";
        if(!rawText) throw new Error("Gemini: réponse vide");
        break;
      }catch(e){
        lastErr = e;
      }
    }

    if(!rawText){
      throw lastErr || new Error("Gemini: échec");
    }

    // Strip possible code fences
    const cleaned = String(rawText).replace(/```json/gi,'').replace(/```/g,'').trim();
    const cardData = JSON.parse(cleaned);

    const parsed = {
      prenom: cardData?.prenom || "",
      nom: cardData?.nom || "",
      club: cardData?.club || "",
      marque: cardData?.editeur || "",
      collection: cardData?.collection || ""
    };

    fillScanForm(parsed, cleaned);
    showToast?.("OCR OK : champs pré-remplis", "success");
  }catch(e){
    console.error(e);
    showToast?.(("OCR: " + (e?.message || "erreur")), "error");
  }
}

function applyOcrToForm(text){
  const parsed = parseOcrText(text);
  // Strong player matching using database
  try{
    const lines = String(text||'').replace(/\r/g,'\n').split('\n').map(l=>l.trim()).filter(Boolean);
    const mp = matchPlayerFromOcrLines(lines);
    if(mp){
      parsed.prenom = mp.prenom || parsed.prenom;
      parsed.nom = mp.nom || parsed.nom;
    }
  }catch(e){ console.warn('player match failed', e); }

  fillScanForm(parsed, text);
}


function _normKey(s){
  return String(s||"")
    .toLowerCase()
    .normalize("NFD").replace(/\p{Diacritic}/gu,"")
    .replace(/[^a-z0-9' -]+/g," ")
    .replace(/\s+/g," ")
    .trim();
}
function matchPlayerFromOcrLines(lines){
  // exact alias lookup first
  let best = {id:"", score:0};
  for(const line of lines){
    const base = _normKey(line);
    if(!base) continue;

    const variants = new Set([
      base,
      base.replace(/\//g," "),
      base.replace(/-/g," "),
      base.replace(/\s+/g," ").trim(),
    ]);

    // also try: drop short tokens, join
    for(const v of Array.from(variants)){
      if(PLAYER_ALIAS_INDEX[v]){
        // score by length of alias matched
        const score = Math.min(60, v.length) + 20;
        const id = PLAYER_ALIAS_INDEX[v][0]; // take first if multiple
        if(score > best.score) best = {id, score};
      }
    }
  }

  if(best.id && PLAYERS_BY_ID[best.id]) return {player_id: best.id, ...PLAYERS_BY_ID[best.id], score: best.score};

  // fallback: try to find two-word candidates and look up
  for(const line of lines){
    const base = _normKey(line);
    const parts = base.split(" ").filter(Boolean);
    if(parts.length < 2 || parts.length > 3) continue;
    const joined = parts.join(" ");
    if(PLAYER_ALIAS_INDEX[joined]){
      const id = PLAYER_ALIAS_INDEX[joined][0];
      return {player_id: id, ...PLAYERS_BY_ID[id], score: 40};
    }
  }
  return null;
}

function parseOcrText(raw){
  const text = String(raw||"");
  const lines = text.replace(/\r/g,"\n").split("\n").map(l=>l.trim()).filter(Boolean);
  const U = lines.map(l=>l.toUpperCase());

  const brandMap = [
    {re:/\bTOPPS\b/, v:"Topps"},
    {re:/\bPANINI\b/, v:"Panini"},
    {re:/\bLEAF\b/, v:"Leaf"},
    {re:/\bFUTERA\b/, v:"Futera"},
    {re:/\bDAKA\b/, v:"Daka"},
  ];

  let marque = "";
  for(const b of brandMap){
    if(U.some(l=>b.re.test(l))){ marque=b.v; break; }
  }

  const years = [];
  for(const l of U){
    const m = l.match(/\b(19[5-9]\d|20[0-4]\d|2050)\b/g);
    if(m) m.forEach(y=>years.push(parseInt(y,10)));
  }
  years.sort((a,b)=>b-a);
  const annee = years[0] ? String(years[0]) : "";

  let num = "";
  for(const l of U){
    const m = l.match(/(?:#|NO\.?|N°)\s*([0-9]{1,4})\b/);
    if(m){ num = m[1]; break; }
  }

  let sport = "";
  const sportRules = [
    {re:/\bNBA\b|\bBASKETBALL\b/, v:"basketball"},
    {re:/\bNFL\b|\bAMERICAN\s+FOOTBALL\b/, v:"nfl"},
    {re:/\bMLB\b|\bBASEBALL\b/, v:"baseball"},
    {re:/\bNHL\b|\bHOCKEY\b/, v:"nhl"},
    {re:/\bFORMULA\s*1\b|\bF1\b/, v:"f1"},
    {re:/\bTENNIS\b/, v:"tennis"},
    {re:/\bSOCCER\b|\bUEFA\b|\bFIFA\b|\bCHAMPIONS\b|\bLEAGUE\b|\bUCL\b|\bLALIGA\b|\bSERIE\s*A\b|\bBUNDESLIGA\b|\bLIGUE\s*1\b/, v:"football"},
  ];
  for(const r of sportRules){
    if(U.some(l=>r.re.test(l))){ sport=r.v; break; }
  }
  if(!sport && (marque==="Topps" || marque==="Panini")) sport="football";

  const setKeywords = [
    "CHROME","FINEST","MERLIN","MUSEUM","SELECT","PRIZM","MOSAIC","OBSIDIAN",
    "STADIUM CLUB","MATCH ATTAX","REVOLUTION","IMPECCABLE","NATIONAL TREASURES",
    "DONRUSS","OPTIC","SCORE","THREADS","PATCH","AUTO","AUTOGRAPH"
  ];
  let setName = "";
  for(const kw of setKeywords){
    const re = new RegExp("\\b"+kw.replace(/ /g,"\\s+")+"\\b","i");
    if(lines.some(l=>re.test(l))){ setName = kw; break; }
  }

  const STOP = new Set([
    "TOPPS","PANINI","LEAF","FUTERA","DAKA","ROOKIE","RC","AUTOGRAPH","AUTO","SIGNATURE",
    "CHROME","FINEST","MERLIN","SELECT","PRIZM","MOSAIC","OBSIDIAN","STADIUM","CLUB","MATCH","ATTAX",
    "UEFA","FIFA","CHAMPIONS","LEAGUE","UCL","COPA","WORLD","CUP","TEAM","EDITION","LIMITED","SERIAL",
    "NUMBERED","BASE","CARD","TRADING","COLLECTION","OFFICIAL","LICENSED","SEASON"
  ]);

  function cleanLetters(s){
    return String(s||"")
      .replace(/[0-9]/g," ")
      .replace(/[^A-Za-zÀ-ÖØ-öø-ÿ' -]/g," ")
      .replace(/\s+/g," ")
      .trim();
  }

  const clubHints = [
    "PARIS","SAINT","GERMAIN","PSG","REAL","BARCELONA","ATLETICO","MANCHESTER","UNITED","CITY",
    "LIVERPOOL","CHELSEA","ARSENAL","TOTTENHAM","INTER","MILAN","JUVENTUS","NAPOLI","ROMA","LAZIO",
    "BAYERN","DORTMUND","LEIPZIG","BENFICA","PORTO","SPORTING","AJAX","FEYENOORD","CELTIC","RANGERS",
    "MARSEILLE","LYON","LILLE","MONACO","RENNES","NICE","SEVILLA","VALENCIA","VILLARREAL","PSV",
    "GALATASARAY","FENERBAHCE","BESIKTAS"
  ];

  function scoreClub(line){
    const u = line.toUpperCase();
    if(u.length < 3 || u.length > 45) return -1;
    if(/\d/.test(u)) return -1;
    if(/\b(CLUB|TEAM)\b\s*[:\-]/.test(u)) return 30;
    let s = 0;
    if(/\b(FC|CF|SC|AC|AFC|SSC|BSC)\b/.test(u)) s += 10;
    for(const h of clubHints){ if(u.includes(h)) s += 4; }
    const parts = cleanLetters(line).split(" ").filter(Boolean);
    if(parts.length>=2 && parts.length<=6) s += 6;
    if(s < 10 && parts.length<=3) s -= 2;
    return s;
  }

  let club = "";
  // club from DB
  const clubFromDb = matchClubFromText(lines);
  if(clubFromDb) club = clubFromDb;
  let bestClubScore = -1;
  for(const l of lines){
    const sc = scoreClub(l);
    if(sc > bestClubScore){ bestClubScore=sc; club=l; }
  }
  if(club){
    const m = club.match(/(?:CLUB|TEAM)\s*[:\-]\s*(.+)$/i);
    if(m) club = m[1].trim();
  }
  if(bestClubScore < 8) club = "";

  function scorePlayer(line){
    const cleaned = cleanLetters(line);
    const u = cleaned.toUpperCase();
    if(!cleaned) return -1;
    if(cleaned.length < 4 || cleaned.length > 30) return -1;
    if(/\d/.test(line)) return -1;
    const parts = cleaned.split(" ").filter(Boolean);
    if(parts.length > 3) return -1;

    const upperParts = parts.map(p=>p.toUpperCase());
    if(upperParts.some(p=>STOP.has(p))) return -1;
    if(brandMap.some(b=>b.re.test(u))) return -1;
    if(setKeywords.some(kw=>u.includes(kw))) return -1;
    if(club && u === cleanLetters(club).toUpperCase()) return -1;

    let s = 0;
    if(parts.length===2) s += 16;
    if(parts.length===3) s += 12;
    if(parts.length===1) s += 9;

    if(line === line.toUpperCase()) s += 4;
    if(/\b(FC|CF|SC|AC)\b/i.test(u)) s -= 6;
    if(/^[A-Za-zÀ-ÖØ-öø-ÿ' -]+$/.test(cleaned)) s += 3;

    const idx = lines.indexOf(line);
    if(idx >= 0) s += Math.max(0, 6 - idx);

    return s;
  }

  let bestName = "";
  let bestScore = -1;
  for(const l of lines){
    const sc = scorePlayer(l);
    if(sc > bestScore){ bestScore=sc; bestName=l; }
  }

  let prenom = "", nom = "";
  if(bestScore >= 10 && bestName){
    const cleaned = cleanLetters(bestName);
    const parts = cleaned.split(" ").filter(Boolean);
    if(parts.length>=2){
      prenom = parts[0];
      nom = parts.slice(1).join(" ");
    }else{
      nom = cleaned;
    }
  }

  let collection = setName ? setName : "";
  if(!collection){
    const cand = lines.find(l=>{
      const u=l.toUpperCase();
      if(bestName && u===bestName.toUpperCase()) return false;
      if(club && u===club.toUpperCase()) return false;
      if(u.length<8 || u.length>40) return false;
      if(/\d{4}/.test(u)) return false;
      if(brandMap.some(b=>b.re.test(u))) return false;
      return /(CHROME|FINEST|MERLIN|SELECT|PRIZM|MOSAIC|STADIUM|ATTAX|DONRUSS|OPTIC|IMPECCABLE|TREASURES)/.test(u);
    });
    if(cand) collection = cand;
  }

  return { prenom, nom, sport, club, marque, annee, set:setName, collection, num };
}

function _setValue(id, val){
  const el = document.getElementById(id);
  if(!el) return false;
  el.value = val ?? "";
  el.dispatchEvent(new Event('input', {bubbles:true}));
  el.dispatchEvent(new Event('change', {bubbles:true}));
  return true;
}

function fillScanForm(parsed, rawText){
  // Always store raw OCR in notes (keeps trace)
  const notesEl = document.getElementById('f-notes');
  if(notesEl){
    const header = "OCR:\\n";
    const existing = String(notesEl.value||"");
    notesEl.value = existing.includes(header) ? existing : (header + rawText.trim() + "\\n\\n" + existing).trim();
    notesEl.dispatchEvent(new Event('input', {bubbles:true}));
  }

  if(parsed.prenom) _setValue('f-prenom', parsed.prenom);
  if(parsed.nom) _setValue('f-nom', parsed.nom);
  if(parsed.sport) _setValue('f-sport', parsed.sport);
  if(parsed.marque) _setValue('f-marque', parsed.marque);
  if(parsed.annee) _setValue('f-annee', parsed.annee);
  if(parsed.num) _setValue('f-num', parsed.num);

  // Club: depends on your UI (search input)
  if(parsed.club){
    const clubSearch = document.getElementById('f-club-search');
    if(clubSearch){
      clubSearch.value = parsed.club;
      clubSearch.dispatchEvent(new Event('input', {bubbles:true}));
    }
  }

  // Set / collection
  if(parsed.set){
    // your UI uses f-set (select) shown depending on brand
    const ok = _setValue('f-set', parsed.set);
    if(!ok){
      // fallback: store in collection field
      _setValue('f-collection', parsed.set);
    }
  }
  if(parsed.collection){
    _setValue('f-collection', parsed.collection);
  }
}

// --- Crop controls (size + contrast/brightness) ---
function _getCropControls(){
  return {
    size: document.getElementById('crop-size'),
    contrast: document.getElementById('crop-contrast'),
    brightness: document.getElementById('crop-brightness'),
    wrap: document.querySelector('#crop-overlay .crop-wrap')
  };
}

function _applyCropUi(){
  const {size, contrast, brightness, wrap} = _getCropControls();
  if(!wrap) return;
  const inset = size ? Number(size.value||16) : 16;
  wrap.style.setProperty('--cropInset', inset+'px');

  // live preview filter on canvas
  const c = document.getElementById('crop-canvas');
  if(c){
    const con = contrast ? Number(contrast.value||100) : 100;
    const bri = brightness ? Number(brightness.value||100) : 100;
    c.style.filter = `contrast(${con}%) brightness(${bri}%)`;
  }
}

document.addEventListener('input', (e)=>{
  if(e.target && (e.target.id==='crop-size' || e.target.id==='crop-contrast' || e.target.id==='crop-brightness')){
    _applyCropUi();
  }
}, true);

// call when opening crop
const _origInitCrop = (typeof initCrop === 'function') ? initCrop : null;
if(_origInitCrop){
  window.initCrop = function(){
    _origInitCrop();
    _applyCropUi();
  }
}

