function _normKey(s){
  return String(s||"")
    .normalize('NFD').replace(/[\u0300-\u036f]/g,'')
    .toLowerCase()
    .replace(/[^a-z0-9]+/g,' ')
    .replace(/\s+/g,' ')
    .trim();
}

function matchClubFromText(lines){
  // Try exact/alias lookup first
  const candidates = new Map(); // id -> score
  for(const line of lines){
    const k = _normKey(line);
    if(!k) continue;
    // direct lookup
    const hits = CLUBS_ALIAS_INDEX[k];
    if(hits){
      for(const id of hits) candidates.set(id, (candidates.get(id)||0) + 40);
    }
    // token-based: try dropping short tokens
    const parts = k.split(' ');
    if(parts.length>=2){
      const k2 = parts.filter(p=>p.length>2).join(' ');
      const hits2 = CLUBS_ALIAS_INDEX[k2];
      if(hits2) for(const id of hits2) candidates.set(id, (candidates.get(id)||0) + 22);
    }
    // acronym-like (e.g., "psg", "om")
    if(k.length<=4){
      const hits3 = CLUBS_ALIAS_INDEX[k];
      if(hits3) for(const id of hits3) candidates.set(id, (candidates.get(id)||0) + 30);
    }
  }
  if(candidates.size===0) return "";

  // choose best
  let bestId="", bestScore=-1;
  for(const [id,sc] of candidates.entries()){ if(sc>bestScore){ bestScore=sc; bestId=id; } }
  const club = CLUBS_DB.find(c=>c.club_id===bestId);
  return club ? club.name : "";
}
