function ensureSearchResultsBox(inputEl){
  const id = inputEl.id + "-results";
  let box = document.getElementById(id);
  if(box) return box;
  box = document.createElement("div");
  box.id = id;
  box.className = "search-results";
  inputEl.parentElement?.appendChild(box);
  return box;
}
function renderSearchResults(box, cards){
  box.innerHTML = "";
  if(!cards.length){ box.style.display="none"; return; }
  const frag = document.createDocumentFragment();
  cards.slice(0, 24).forEach(c=>{
    const row = document.createElement("div");
    row.className = "sr-row";
    row.dataset.cardId = c.id;

    const img = document.createElement("img");
    img.className = "sr-thumb";
    img.alt = "";
    img.src = _cardThumb(c) || "";
    row.appendChild(img);

    const meta = document.createElement("div");
    meta.className = "sr-meta";
    const t = document.createElement("div");
    t.className = "sr-title";
    t.textContent = _cardTitle(c);
    const sub = document.createElement("div");
    sub.className = "sr-sub";
    sub.textContent = [c.club, c.marque, c.annee].filter(Boolean).join(" • ");
    meta.appendChild(t); meta.appendChild(sub);
    row.appendChild(meta);

    row.addEventListener("click", ()=>{
      box.style.display="none";
      const playerName = ((c.prenom||'')+' '+(c.nom||'')).trim();
      if(playerName){
        location.href = 'player.html?name=' + encodeURIComponent(playerName);
      } else {
        openCard(c.id);
      }
    });
    frag.appendChild(row);
  });
  box.appendChild(frag);
  box.style.display="block";
}
function localSearchCards(q){
  const nq = _norm(q);
  if(!nq) return [];
  const parts = nq.split(" ");
  return (db?.cards || []).filter(c=>{
    const hay = _norm([c.prenom,c.nom,c.club,c.marque,c.collection,c.set,c.sport].filter(Boolean).join(" "));
    return parts.every(p=>hay.includes(p));
  });
}
function debounce(fn, wait){
  let t=0;
  return (...args)=>{
    clearTimeout(t);
    t=setTimeout(()=>fn(...args), wait);
  };
}
function setupLiveSearch(){
  const inputs = [document.getElementById("home-search"), document.getElementById("coll-search")].filter(Boolean);
  inputs.forEach(inp=>{
    const box = ensureSearchResultsBox(inp);
    const run = debounce(()=>{
      const q = inp.value || "";
      const results = localSearchCards(q);
      renderSearchResults(box, results);

      // Also filter main lists live
      if(inp.id==="home-search"){
        curSearch = q;
        renderHome();
      }else{
        curSearch = q;
        renderCollection();
      }
    }, 160);

    inp.addEventListener("input", run);

    // hide on blur (with small delay to allow click)
    inp.addEventListener("blur", ()=>setTimeout(()=>{ box.style.display="none"; }, 180));
    inp.addEventListener("focus", ()=>{ if(inp.value.trim()) run(); });
  });
}

