function _sportLabel(s){
  const map = {football:"Football",basketball:"Basketball",baseball:"Baseball",nfl:"NFL",nhl:"NHL",tennis:"Tennis",f1:"F1"};
  return map[s] || (s? (s[0].toUpperCase()+s.slice(1)) : "Sport");
}
function _renderFilterPills(el, items, current, onPick){
  el.innerHTML = "";
  const isBrandRow = (el && typeof el.id === "string" && el.id.toLowerCase().includes("brand"));

  const all = document.createElement("div");
  all.className = "pill-tag"+(!current?" on":"");
  all.textContent = "TOUT";
  all.onclick = ()=>onPick("");
  el.appendChild(all);

  items.forEach(it=>{
    const d=document.createElement("div");
    d.className="pill-tag"+(current===it?" on":"");
    if(isBrandRow){
      d.innerHTML = brandLogoHtml(it, 14);
    }else{
      d.textContent = String(it||"").toUpperCase();
    }
    d.onclick=()=>onPick(it);
    el.appendChild(d);
  });
}

function _renderSpecPills(el, spec, onToggle){
  const defs = [["auto","AUTO"],["patch","PATCH"],["rookie","ROOKIE"],["numbered","NUMÉROTÉE"]];
  el.innerHTML="";
  defs.forEach(([k,label])=>{
    const d=document.createElement("div");
    d.className="pill-tag"+(spec[k]?" on":"");
    d.textContent=label;
    d.onclick=()=>onToggle(k);
    el.appendChild(d);
  });
}
function renderCardsGrid(container, cards){
  // Match Collection grid style (colls-grid / coll-thumb)
  container.innerHTML = "";
  const frag = document.createDocumentFragment();
  cards.forEach(c=>{
    const item = document.createElement("div");
    item.className = "coll-thumb";
    item.dataset.cardId = c.id;
    const src = (c.photoRecto||c.img||c.photo||c.recto||c.front||c.image||"");
    item.innerHTML = src
      ? `<img src="${src}" alt="">`
      : `<div class="coll-thumb-empty">${c.clubEmoji||"🃏"}</div>`;
    item.onclick = ()=>openCard(c.id);
    frag.appendChild(item);
  });
  container.appendChild(frag);

  // empty state if available
  const empty = container.parentElement?.querySelector?.(".empty-state") || null;
  if(empty){
    empty.style.display = cards.length ? "none" : "block";
  }
}





