function showView(id){
  // Hide any known screens
  document.querySelectorAll('.view').forEach(v=>{ v.style.display='none'; });
  document.querySelectorAll('[id^="view-"],[id^="page-"],[id^="screen-"]').forEach(v=>{ v.style.display='none'; });

  const el=document.getElementById(id);
  if(el){ el.style.display='block'; return; }

  // fallback: if asked for home/collection/add/scan but ids differ
  const map={home:"view-home",collection:"view-collection",add:"view-add",scan:"view-scan"};
  const fallback=document.getElementById(map[id]||id);
  if(fallback) fallback.style.display='block';
}


