// View stack for Back
const _viewStack = [];
function navTo(viewId){
  // close overlays/modals so the target page is visible immediately
  try{ document.getElementById("card-detail")?.classList.remove("open"); }catch(e){}
  try{ document.getElementById("crop-overlay")?.classList.remove("open"); }catch(e){}
  try{ document.body.classList.remove("modal-open"); }catch(e){}
  // remember current view
  const current = document.querySelector('[id^="view-"][style*="display: block"]')?.id || null;
  if(current && current !== viewId) _viewStack.push(current);
  showView(viewId);
}
function navBack(defaultView="page-home"){
  const prev = _viewStack.pop() || defaultView;
  showView(prev);
}



