// Override navigate: cross-page navigation
let _lastNav = 0;
function navigate(p){
  // Anti-double-tap guard (50ms)
  const now = Date.now();
  if(now - _lastNav < 50) return;
  _lastNav = now;
  // Same-page navigation (home ↔ collection ↔ scanner on index.html)
  if(_PAGE === 'index' || _PAGE === ''){
    curPage = p;
    document.querySelectorAll('.page').forEach(x=>{ try{ x.classList.remove('active'); }catch(e){} });
    document.querySelectorAll('.tab-btn').forEach(x=>{ try{ x.classList.remove('active'); }catch(e){} });
    const pageEl = document.getElementById('page-'+p);
    const tabEl  = document.getElementById('tab-'+p);
    if(pageEl) pageEl.classList.add('active');
    if(tabEl)  tabEl.classList.add('active');
    try{ document.getElementById('card-detail')?.classList.remove('open'); }catch(e){}
    try{ document.getElementById('crop-overlay')?.classList.remove('open'); }catch(e){}
    try{ document.body.classList.remove('modal-open'); }catch(e){}
    if(p==='home' && typeof renderHome==='function') renderHome();
    if(p==='collection' && typeof renderCollection==='function') renderCollection();
    return;
  }
  if(_PAGE === 'collection'){
    if(p==='home'){ location.href='index.html'; return; }
    if(p==='scanner'){ location.href='scanner.html'; return; }
    return;
  }
  if(_PAGE === 'scanner'){
    if(p==='home'){ location.href='index.html'; return; }
    if(p==='collection'){ location.href='collection.html'; return; }
    return;
  }
  // Pages info (card, player, sports, club, dossier) → toujours aller vers l'accueil pour home/collection/scanner
  if(_PAGE === 'card' || _PAGE === 'player' || _PAGE === 'sports' || _PAGE === 'club' || _PAGE === 'dossier'){
    const map = {home:'index.html', collection:'collection.html', scanner:'scanner.html'};
    if(map[p]) location.href = map[p];
    return;
  }
  // Default fallback
  const map = {home:'index.html', collection:'collection.html', scanner:'scanner.html'};
  if(map[p]) location.href = map[p];
}
window.navigate = navigate;

// Override openCard: go to card.html?id=...
function openCard(id){
  const sid = String(id);
  const c = (db?.cards||[]).find(x=>String(x.id)===sid) || null;
  if(!c){ showToast('Carte introuvable'); return; }
  // Store in sessionStorage so card.html can load it fast
  try{ sessionStorage.setItem('cv_card_id', sid); }catch(e){}
  location.href = 'card.html?id=' + encodeURIComponent(sid);
}
window.openCard = openCard;

/* _displayCard : affiche une carte dans le card-detail avec les vrais IDs */
function _displayCard(c){
  if(!c) return;
  const sid = String(c.id);
  curCardId = sid;
  isFlipped = false;

  const frontSrc = c.photoRecto || c.img || c.photo || c.recto || c.front || c.image || '';
  const backSrcRaw = c.photoVerso || c.verso || c.img_v || c.back || '';
  const backSrc = (!backSrcRaw || /placeholder|none/i.test(String(backSrcRaw))) ? '' : String(backSrcRaw);

  // Fond texte (si pas de photo)
  const bgT = document.getElementById('card-bg-name-text');
  if(bgT){ bgT.textContent = !frontSrc ? (c.nom||'').toUpperCase() : ''; bgT.style.display = !frontSrc ? 'block' : 'none'; }

  // Photo recto → card-3d-content
  const fc = document.getElementById('card-3d-content');
  if(fc){
    if(frontSrc){ fc.innerHTML = `<img src="${frontSrc}" style="width:100%;height:100%;object-fit:cover;border-radius:inherit;" alt="">`; fc.classList.remove('card-3d-placeholder'); }
    else { fc.innerHTML = '<span style="font-size:40px;opacity:.25;">🃏</span>'; fc.classList.add('card-3d-placeholder'); }
  }

  // Photo verso → card-3d-content-back
  const bc = document.getElementById('card-3d-content-back');
  if(bc){
    if(backSrc){ bc.innerHTML = `<img src="${backSrc}" style="width:100%;height:100%;object-fit:cover;border-radius:inherit;" alt="">`; bc.classList.remove('card-3d-placeholder'); }
    else { bc.innerHTML = '<span style="font-size:40px;opacity:.25;"></span>'; bc.classList.add('card-3d-placeholder'); }
  }

  // Reset flip
  const fi = document.getElementById('card-flip-inner');
  if(fi){ fi.style.transform = ''; fi.style.transition = ''; }

  // Favori
  const fb = document.getElementById('detail-fav-btn');
  setFavBtn(fb, !!c.fav);

  // Prénom / Nom
  const dp = document.getElementById('detail-prenom');
  if(dp) dp.textContent = c.prenom || '';
  const dn = document.getElementById('detail-nom');
  if(dn) dn.textContent = c.nom || '—';

  // Drapeau
  const fl = document.getElementById('detail-flag');
  if(fl){ fl.textContent = c.drapeauEmoji || ''; fl.style.display = c.drapeauEmoji ? '' : 'none'; }

  // Chip CLUB
  const clubChip = document.getElementById('detail-club-chip');
  const clubLogo = document.getElementById('detail-club-logo');
  const cn = document.getElementById('detail-club-n');
  if(c.club){
    if(cn) cn.textContent = c.club;
    if(clubLogo && typeof getClubLogoB64 === 'function'){
      const src = getClubLogoB64(c.club);
      if(src) clubLogo.src = src;
    }
    if(clubChip) clubChip.style.display = '';
  } else {
    if(clubChip) clubChip.style.display = 'none';
  }

  // Chip SPORT
  const sportChip = document.getElementById('detail-sport-chip');
  const sportIcon = document.getElementById('detail-sport-icon');
  const sl = document.getElementById('detail-sport-label');
  if(c.sport){
    if(sl) sl.textContent = typeof sportL === 'function' ? sportL(c.sport) : c.sport;
    if(sportIcon && typeof SPORT_ICONS !== 'undefined' && SPORT_ICONS[c.sport]){
      sportIcon.src = SPORT_ICONS[c.sport];
    }
    if(sportChip) sportChip.style.display = '';
  } else {
    if(sportChip) sportChip.style.display = 'none';
  }

  // Numérotée
  const numWrap = document.querySelector('#detail-num')?.parentElement;
  if(numWrap) numWrap.style.display = (c.isNum || c.num) ? '' : 'none';
  const numEl = document.getElementById('detail-num');
  if(numEl) numEl.textContent = c.num ? '/' + c.num : '';

  // Badges (auto, patch, rookie)
  const badges = document.getElementById('detail-badges');
  if(badges){
    const tags = [];
    if(c.auto) tags.push('<span class="spec-badge">Auto</span>');
    if(c.patch) tags.push('<span class="spec-badge">Patch</span>');
    if(c.rookie) tags.push('<span class="spec-badge">Rookie</span>');
    badges.innerHTML = tags.join('');
  }

  // Spécificités (chip-tags-row)
  const tagsRow = document.getElementById('chip-tags-row');
  const tagsVal = document.getElementById('d-tags-val');
  if(tagsVal){
    const specParts = [];
    if(c.auto) specParts.push('Auto');
    if(c.patch) specParts.push('Patch');
    if(c.rookie) specParts.push('Rookie');
    if(c.isNum && c.num) specParts.push('/'+c.num);
    tagsVal.textContent = specParts.join(' · ') || '—';
  }

  // Marque (logo si dispo)
  const dmLogo = document.getElementById('d-marque-logo');
  const dmText = document.getElementById('d-marque-text');
  // Fallback for pages that still use #d-marque
  const dmLegacy = document.getElementById('d-marque');

  if(dmLogo && typeof BRANDS_DB !== 'undefined' && c.marque && BRANDS_DB[c.marque]){
    dmLogo.src = BRANDS_DB[c.marque];
    dmLogo.style.display = '';
    if(dmText) dmText.style.display = 'none';
  } else {
    if(dmLogo) dmLogo.style.display = 'none';
    if(dmText){ dmText.style.display = ''; dmText.textContent = c.marque || '—'; }
  }
  if(dmLegacy) dmLegacy.textContent = c.marque || '—';

  // Année / Set
  const dy = document.getElementById('d-annee');  if(dy) dy.textContent = c.annee  || '—';
  const ds = document.getElementById('d-set');    if(ds) ds.textContent = c.setName || c.set || '—';

  // Dossier
  const dc = document.getElementById('d-coll'); if(dc) dc.textContent = c.collection || '—';

  // Prix
  const dpr = document.getElementById('d-price');
  if(dpr) dpr.textContent = typeof fmtPrice === 'function' ? fmtPrice(c.price) : (c.price ? c.price+'€' : '—');

  // Gyro/swipe
  try{ if(typeof initGyroAndSwipe === 'function') initGyroAndSwipe(); }catch(e){}
}
window._displayCard = _displayCard;


// Override openPlayer: go to player.html?name=...
function openPlayer(key){
  // key peut être un id de carte OU un nom de joueur
  const sid = String(key||'');
  let c0 = (db?.cards||[]).find(c=>String(c.id)===sid) || null;
  let playerName = c0 ? (((c0.prenom||'')+' '+(c0.nom||'')).trim()||c0.player||'') : sid;
  // Si on a passé directement un nom (pas un id), vérifier
  if(!c0){ c0 = (db?.cards||[]).find(c=>(((c.prenom||'')+' '+(c.nom||'')).trim())===sid) || null; }
  if(!playerName || playerName === sid && !c0){ showToast('Joueur introuvable'); return; }
  location.href = 'player.html?name=' + encodeURIComponent(playerName);
}
window.openPlayer = openPlayer;

