// Override loadFromDB: load then call the right render for the current page
const _origLoadFromDB = loadFromDB;
async function loadFromDB(){
  showLoader(true);
  try{
    await loadBrandLogos();
    const[cards,folders]=await Promise.all([sbGet('cards'),sbGet('folders')]);
    db.cards=Array.isArray(cards)?cards.map(fromSB):[];
    db.folders=Array.isArray(folders)?folders:[];
    db.cards.sort((a,b)=>b.id.localeCompare(a.id));
  }catch(e){console.error(e);showToast(' Erreur de connexion');}
  showLoader(false);

  // Page-specific render on load
  const pg = _PAGE;
  if((pg==='index'||pg==='') && typeof renderHome==='function') renderHome();
  else if(pg==='collection' && typeof renderCollection==='function') renderCollection();
  else if(pg==='scanner'){
    if(typeof populateYears==='function'){ populateYears('f-annee'); populateYears('e-annee'); }
    if(typeof updateCollSel==='function') updateCollSel();
  }
  else if(pg==='card'){
    if(typeof _pageCard==='function') _pageCard();
  }
  else if(pg==='player'){
    if(typeof _pagePlayer==='function') _pagePlayer();
  }
  else if(pg==='club'){
    if(typeof _pageClub==='function') _pageClub();
  }
  else if(pg==='sports'){
    if(typeof _pageSports==='function') _pageSports();
  }
  else if(pg==='dossier'){
    if(typeof _pageDossier==='function') _pageDossier();
  }
}
window.loadFromDB = loadFromDB;

// tabbar active state on load
document.addEventListener('DOMContentLoaded', ()=>{
  const pg = _PAGE;
  document.querySelectorAll('.tab-btn').forEach(b=>b.classList.remove('active'));
  const active = {index:'tab-home','':'tab-home',collection:'tab-collection',scanner:'tab-scanner'};
  const tabId = active[pg];
  if(tabId){ const el=document.getElementById(tabId); if(el) el.classList.add('active'); }

  // Collection page: default tab is "Cartes"
  if(pg==='collection' && document.getElementById('coll-panel-cards')){
    try{ switchCollectionTab('cards'); }catch(e){}
  }
});

// Collection tabs
function switchCollectionTab(which){
  const cardsBtn = document.getElementById('coll-tab-cards');
  const valBtn = document.getElementById('coll-tab-value');
  const cardsPanel = document.getElementById('coll-panel-cards');
  const valPanel = document.getElementById('coll-panel-value');
  if(!cardsPanel || !valPanel) return;

  const isCards = (which==='cards');
  cardsPanel.style.display = isCards ? '' : 'none';
  valPanel.style.display = isCards ? 'none' : '';
  if(cardsBtn) cardsBtn.classList.toggle('active', isCards);
  if(valBtn) valBtn.classList.toggle('active', !isCards);
}
